import React from "react";
import NavBar from "./NavBar.js";
import ToDo from "./ToDo.js";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";

function App(props) {
  return (
    <div>
      <NavBar />
      <Grid container spacing={16}
      style={{padding:"16px"}}>
        <Grid item xs={6}>
          <Paper>
            <ToDo />
          </Paper>
        </Grid>
        // <Grid item xs={6}>
        //   <Paper>
        //     <ToDo />
        //   </Paper>
        // </Grid>
      </Grid>
    </div>
  );
}

export default App;
